import React from "react";
import { Header, Footer, GameForm, Recommendation, Info } from "../components";

const Main = () => {
  return (
    <div>
      <Header />
      <div className="flex pl-2 pr-2">
        <Info />
        <GameForm />
        <Recommendation />
      </div>
      <Footer />
    </div>
  );
};

export default Main;
